server <- function(input, output) {
  output$oplot <- renderPlot({
    input$submit
    isolate({
      circos.clear()
      circos.par("gap.degree" = 0, start.degree = 90)
      ffold = input$ifold
      if (is.null(ffold))
        return(NULL)
      bed = data.frame(ID = 1,
                       start = 1,
                       end = 4639675)
      gap = bed$end / 3600
      circos.initializeWithIdeogram(bed, major.by = 200000, plotType = c("axis"))
      start=sort(sample(x=bed$end,size=100,replace = FALSE))
      end=start+sample(x=bed$end/100,size = 100,replace=TRUE)
      fold = data.frame(ID = rep(1,100),
                        start = start,
                        end = end)
      circos.genomicTrackPlotRegion(
        ylim = c(0, 1),
        fold,
        panel.fun = function(region, value, ...) {
          circos.genomicRect(region, value, col = "black", border = NA)
        },
        bg.border = NA,
        bg.col = "white",
        track.height = 0.1
      )
      
      fnap = input$inap
      if (is.null(fnap))
        return(NULL)
      nap = read.table(fnap$datapath, sep = "\t")
      nap[, 1] = rep(1, nrow(nap))
      nap[, 3] = nap[, 2] + gap
      circos.genomicTrackPlotRegion(
        ylim = c(0, 1),
        nap,
        panel.fun = function(region, value, ...) {
          circos.genomicRect(region, value, col = "green", border = NA)
        },
        bg.border = NA,
        track.height = 0.05
      )
      
      fhigh = input$ihigh
      if (is.null(fhigh))
        return(NULL)
      start=sort(sample(x=bed$end,size=100,replace = FALSE))
      end=start+sample(x=bed$end/100,size = 100,replace=TRUE)
      high = data.frame(ID = rep(1,100),
                        start = start,
                        end = end
      )
      circos.genomicTrackPlotRegion(
        ylim = c(0, 1),
        high,
        panel.fun = function(region, value, ...) {
          circos.genomicRect(region, value, col = "blue", border = NA)
        },
        bg.border = NA,
        track.height = 0.05
      )
      
      fdetail = input$idetail
      if (is.null(fdetail))
        return(NULL)
      link = read.table(fdetail$datapath, sep = "\t")
      g1 = data.frame(ID = rep(1, nrow(link)),
                      start = link[, 4],
                      end = link[, 5])
      g2 = data.frame(ID = rep(1, nrow(link)),
                      start = link[, 7],
                      end = link[, 8])
      
      g = c(link[, 4], link[, 7])
      count = as.numeric(table(g))
      g = as.numeric(names(table(g)))
      pair = data.frame(
        ID = rep(1, length(count)),
        start = g,
        end = g + gap,
        value = count
      )
      circos.genomicTrackPlotRegion(
        pair,
        panel.fun = function(region, value, ...) {
          circos.genomicRect(
            region,
            value,
            ytop = pair$value,
            ybottom = 0,
            col = "orange",
            border = NA
          )
        },
        bg.border = NA,
        track.height = 0.15
      )
      
      finfo = input$iinfo
      if (is.null(finfo))
        return(NULL)
      info = read.table(finfo$datapath, sep = "\t")
      path = data.frame(
        ID = rep(1, nrow(info)),
        start = info[, 4],
        end = info[, 5],
        value = info[, 10]
      )
      circos.genomicTrackPlotRegion(
        path,
        panel.fun = function(region, value, ...) {
          circos.genomicRect(
            
            region,
            value,
            ytop = path$value,
            ybottom = 0,
            col = "red",
            border = NA
          )
        },
        bg.border = NA,
        track.height = 0.15
      )
      circos.genomicLink(g1, g2, col = "grey" , border = NA)
    })
  }, width = 650, height = 650)
}

shinyApp(ui = ui, server = server)